import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Catalog.css';

const productData = [
  { id: 1, name: 'HP LaserJet M141cw', description: 'Better version of M111cw, new features.', price: '$2415', image: '/print.png', size: 'Large', color: 'White', type: 'Laser' },
  { id: 2, name: 'HP LaserJet M111cw', description: 'Good choice for average user', price: '$2100', image: '/print2.png', size: 'Medium', color: 'Black', type: 'Laser' },
  { id: 3, name: 'HP LaserJet M110w', description: 'Best value for home and office use.', price: '$1800', image: '/print3.png', size: 'Small', color: 'White', type: 'Inkjet' },
];

export const Catalog = () => {
  const [items] = useState(productData);
  const [searchTerm, setSearchTerm] = useState('');
  const [filters, setFilters] = useState({
    size: '',
    color: '',
    type: ''
  });

  const handleSearch = (e) => {
    setSearchTerm(e.target.value);
  };

  const handleFilterChange = (e) => {
    setFilters({
      ...filters,
      [e.target.name]: e.target.value
    });
  };

  const filteredItems = items.filter(item =>
    item.name.toLowerCase().includes(searchTerm.toLowerCase()) &&
    (filters.size ? item.size === filters.size : true) &&
    (filters.color ? item.color === filters.color : true) &&
    (filters.type ? item.type === filters.type : true)
  );

  return (
    <section className="catalog">
      <h2>Catalog</h2>
      <input
        type="text"
        placeholder="Search by name..."
        value={searchTerm}
        onChange={handleSearch}
      />
      <div className="filters">
        <label>
          Size
          <select name="size" value={filters.size} onChange={handleFilterChange}>
            <option value="">All</option>
            <option value="Large">Large</option>
            <option value="Medium">Medium</option>
            <option value="Small">Small</option>
          </select>
        </label>
        <label>
          Color
          <select name="color" value={filters.color} onChange={handleFilterChange}>
            <option value="">All</option>
            <option value="White">White</option>
            <option value="Black">Black</option>
          </select>
        </label>
        <label>
          Type
          <select name="type" value={filters.type} onChange={handleFilterChange}>
            <option value="">All</option>
            <option value="Laser">Laser</option>
            <option value="Inkjet">Inkjet</option>
          </select>
        </label>
      </div>
      <ul>
        {filteredItems.map(product => (
          <li key={product.id}>
            <img src={product.image} alt={product.name} />
            <h3>{product.name}</h3>
            <p>{product.description}</p>
            <p>{product.price}</p>
            <Link to={`/item/${product.id}`}>
              <button>View more</button>
            </Link>
          </li>
        ))}
      </ul>
    </section>
  );
};
